I have no regrets.  I have had one incredibly bad out of control day out of two months of good and bad days since she first got sick, and out of 8 months on WW.  I tracked it as best I could (the restaurant I went to isn't actually in the app), and will do what I can to get the rest of my week in check.  One bad day didn't get me into this mess and one bad day won't ruin my progress. 

Instead, the bad days really serve to show me that I don't enjoy food the way that I used to.  Yes, it tastes good going down, and it feels better for a moment, but honestly, it doesn't really feel good or worth it anymore.  My self esteem and confidence mean more to me than that temporary happy. 

